      version: metadata.version,
      architecture: metadata.architecture,
      trainedOn: metadata.datasetVersion,
      trainedAt: metadata.timestamp,
      hyperparameters: metadata.config,
      // Chain of custody
      previousVersion: metadata.baseModel,
